REPLACE INTO `dessaul_about` (`id`, `name`, `about`, `mission`, `updated_at`, `created_at`) VALUES
	(1, '了解戴索', '<p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style="text-align: left;"><spanyes font-size:12.0000pt="">&nbsp;<span style="font-size: large;"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<font face="微软雅黑">上海戴索电子科技有限公司，注册资金</font>500万。由一批拥有在仪器电源行业超过10年经验专业人士</span></spanyes><spanyes font-size:12.0000pt=""><span style="font-size: large;">组建，技术、服务夯实。戴索专</span></spanyes><span style="font-size: large;">注于程控电源、电力电子测量及新能源检测系统、航空航天行业产品</span><span style="font-size: large;">销售和一体化专业服务。为客户提供高品质的电源和测量仪器产品以及相关解决方案。</span></p><p style="text-align: left;"><span style="font-size: large;"><br></span></p><p></p><p></p><p style="text-align: left;"><span style="font-size: large;"><spanyes font-size:12.0000pt="">&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<font face="微软雅黑">随着企业的快速发展，戴索科技汇聚行业内各类优秀人才。致力于模块化、标准化、测试自动化</font></spanyes></span><spanyes font-size:12.0000pt="" style="font-size: large;"><font face="微软雅黑">和系统解决方案等领域的开拓创</font></spanyes><span style="font-size: large; font-family: 微软雅黑;">新。主要代理产品阿美特克可编程系列直流电源、交流电源、交流负</span><span style="font-family: 微软雅黑; font-size: large;">载等广泛应用于新能源、航天、重工及相关领域。</span></p><p style="text-align: left;"><span style="font-family: 微软雅黑; font-size: large;"><br></span></p><p></p><p></p><p></p><p style="text-align: left;"><span style="font-size: large;"><spanyes font-size:12.0000pt="">&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<font face="微软雅黑">披星戴月，上下求索。戴索这只年轻而又</font>“资深”的队伍凭借卓越的产品、丰富的行业经验以及强</spanyes></span><spanyes font-size:12.0000pt="" style="font-size: large;">大的专业服务能力，已经成功为科</spanyes><span style="font-size: large;">教、医疗、轨交、能源、制造业等几百家客户及合作伙伴提供了产</span><span style="font-size: large;">品、解决方案及服务。</span></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\nmargin-top:72.0000pt;\r\nmargin-bottom:72.0000pt;\r\nmargin-left:90.0000pt;\r\nmargin-right:90.0000pt;\r\nsize:595.3000pt 841.9000pt;\r\nlayout-grid:15.6000pt;\r\n}\r\ndiv.Section0{page:Section0;}</style><p style="text-align: left;"><br></p>', '<p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h4 style="text-align: center;"><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 7" ></w:LsdException>\r\n<w:LsdException Locked="fal