	(1, '水处理应用方案', 18, '<p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h3 align="center" style="text-align: center;"><b><spanyes font-weight:bold=""><font face="宋体">水处理应用方案</font></spanyes></b></h3><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑"> 水处理一般分为生物法和物理化学法。在物理化学法中电化学方法处理污水具有前</font></spanyes><span style="font-family: 微软雅黑; font-size: 12pt; text-indent: 24pt;">期投资少、效果良好稳定特别是在经过改进后，对多种行业废水的处理过程具有良好的适应性。</span></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb="" style=""><font face="微软雅黑">电化学水处理技术的基本原理是使污染物在电极上发生直接电化学反应或间接电化学转化，即直接电解和间接电解。直接电解是指污染物在电极上直接被氧化或还原而从废水中去除，间接电解是指利用电化学产生的氧化还原物质作为反应剂或催化剂，使污染物转化成毒性更小的物质。</font><spanyes font-size:12.0000pt="" mso-shading:rgb=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb="" style=""><font face="微软雅黑">电化学水净化过程需要的电源通常需要支持恒流恒压的输出模式且可以自动切换输出模式，对于不稳定的负载变化必须具备快速响应能力，具备监测能力。在潮湿环境下，可稳定的使用。</font><spanyes font-size:12.0000pt="" mso-shading:rgb=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb="" style="">AMETEK Sorensen 电源覆盖功率等级从几十瓦至几百千瓦，具有恒流恒压的输出模式且可以自动切换输出模式，输出精准稳定，易于程控和扩展，是完成此类测试的完美选择。以SG系列直流电源为例，功率覆盖范围4kW-150kW；电压编程精度为满量程的0.1%，电流编程精度为满量程的0.4%；低纹波和噪声，电流模式下纹波</spanyes></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes mso-bidi-font-family:="" new="" roman="" style="font-size: 12pt; text-align: center; text-indent: 24pt;"></spanyes></p><p style="text-align: center;"> <img src="data:image/png;base64," class="" style="text-align: center; max-width: 100%;"></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">案例分享：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdException Locked="fa