	(18, '超导研究和直流断路器测试方案', 26, '<p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">超导研究和直流断路器测试方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p>&nbsp;</p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">大电流测试系统可以说是超导研究和直流断路器测试的专业化设备。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;background:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">此系统工作在直流电流模式，电流可达</font>9000A、12000A或15000A，电压可根据用户需求确定；从无电流上升到全电流仅需要25ms。母线是用铜质汇流条制成，大大提高带载能力。除此之外，其还具备紧凑坚固，便于运输等优点。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false