	(14, '电子产品一致性测试方案', 21, '<p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">电子产品一致性测试方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p> </p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">如今全球范围内越来越多的电子产品被要求必须满足电磁辐射和抗扰度国际标准，在欧洲和日本出售的产品尤为如此，一致性测试已经成为各大制造商的必测部分。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK CTS 系统是完整的交钥匙的一致性测试系统解决方案，用于交流或直流供电产品的电磁辐射和抗扰度符合性测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">CTS系统由一台交流电源，功率分析调节系统（PACS）和一台基于数据采集系统的计算机组成。根据电子产品的功率不同，AMETEK 为客户提供ix-CTS系统和 MX-CTS系统，以覆盖不同的IEC标准的测试。基于Windows的软件可执行必要的IEC测试，并生成详细的测试报告。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:54.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø 谐波测试 IEC61000-3-2 <16A/phase<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:114.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">IEC61000-3-12 <75A/phase<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:54.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø 闪烁测试 IEC61000-3-3 <16A/phase<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:114.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">IEC61000-3-11 <75A/phase<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:36.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">另外，一系列抗扰度测试也可以通过</font>CTS系统完成。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø EN 61000-4-11电压暂降和中断(EOS 选件) <spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø EN 61000-4-13 谐波和间谐波(要求选件-413) <spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø EN 61000-4-17 直流纹波<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø EN 61000-4-14 电压波动<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø EN 61000-4-27 不平衡抗扰度试验<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">Ø EN 61000-4-28 频率变化</spanyes></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" style="font-size: 12pt; text-align: center;">Ø EN 61000-4-29 直流暂降和中断(预兼容)</spanyes><img src="data:image/png;base64," style="text-align: center; font-family: "Source Sans Pro", "Helvetica Neue", Helvetica, Arial, sans-serif; font-size: 14px; max-width: 100%;"></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">案例分享：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:21.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">1. 北京、深圳、西安、成都等地众多质检计量单位选购不同功率等级的MXCTS系统用于质检测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:21.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">2. 某吸尘器厂家选购8套ix-CTS系统，用于产线上产品的一致性测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:21.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">3. 某干衣机厂家选购1套MX-CTS系统，用于产线上产品的一致性测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:57.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException L