/font>AMETEK Sorensen程控直流电源配合精密电阻，数据采集系统，温度采集系统，兆欧表，测功机以及工控电脑等可构成完备的测试系统，通过软件平台，组成功能强大且灵活易用的测试系统，可满足不同电机的测试要求。</spanyes></p><p class="MsoNormal"><div style="text-align: center;"><span style="font-size: 10.5pt;">                                                                      </span><img src="data:image/png;base64," style="font-size: 10.5pt; max-width: 100%;"></div><br></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">案例分享：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="MsoNormal"><font face="微软雅黑" style="font-size: 12pt; text-align: left;">某客户选购</font><span style="font-size: 12pt; text-align: left;">XFR系列直流电源1台用于直流马达测试系统。</span></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\nh3{\r\nmso-style-name:"标题 3";\r\nmso-style-noshow:yes;\r\nmso-style-next:正文;\r\nmargin-top:15.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nmso-line-height-alt:12pt;\r\nfont-family:宋体;\r\nfont-weight:bold;\r\nfont-size:18.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style><p><br></p>', '2019-12-14 20:55:30', '2019-12-13 13:11:08'),
	(6, '石墨加热器测试系统的电源方案', 18, '<p></p><p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">石墨加热器测试系统的电源方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p> </p><p></p><p class="MsoNormal" style="text-indent: 0px; margin: 0pt; padding: 0pt; text-align: left;"><font style="text-indent: 24pt;">           </font><font face="微软雅黑" style="font-size: 12pt; text-indent: 24pt;">石墨加热器的工作原理是将样品用进样器定量注入到石墨管中，并以</font><a href="http://www.jasengd.com/cs-shimohuan.html" style="font-size: 12pt; text-indent: 24pt; background-color: rgb(255, 255, 255);"><span yes="" font-size:12.0000pt=""><font face="微软雅黑">石墨管</font></span></a><spanyes font-size:12.0000pt="" style="font-size: 12pt; text-indent: 24pt;"><font face="微软雅黑">作为电阻发热体，通电后迅速升温使试样达到原子化的目的。它由加热电源、保护气控制系统和石墨管状炉组成。其中，外电源加于石墨管两端，供给原子化器能量，电流通过石墨管产生高达</font>3000℃的温度，使置于石墨管中被测元素变为基态原子蒸气。通常加热系统一个闭环系统，即使用电源进行供电，同时在被测器件的多个监测点监测，根据温度数值实时的调整电源的输出。电源总功率可达数十甚至数百千瓦。</spanyes></p><p class="MsoNormal" style="text-indent: 0px; margin: 0pt; padding: 0pt; text-align: left;"><div style="text-align: center;"><span style="font-size: 12pt; text-indent: 24pt;"> </span><img src="data:image/png;base64," style="font-size: 12pt; text-indent: 24pt; max-width: 100%;"></div><br></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK SG系列电源是高功率密度大功率直流源，输出功率覆盖4kW-150kW以上，单台电压范围为0-1000V，可轻松实现多台并联串联，以提高功率等级。低纹波和噪声，编程精度高，可设置恒压，恒流，恒功率输出模式。十分适用于此系统实验所用。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">目前很多客户在使用可控硅电源用于加热测试系统，相对可控硅电源来说，</font>AMETEK SG系列电源的主要优势是动态范围更大，电压和电流可从O开始输出；精度更高，分辨率更高，稳定度更高，纹波噪声小；具有修正的PFC，效率更高，更加节能；输入输出隔离；对电网的影响更小，无需增加隔离设备；单台功率低，也可轻松实现串联和并联以达到较高功率，体积小，灵活性高。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\nh3{\r\nmso-style-name:"标题 3";\r\nmso-style-noshow:yes;\r\nmso-style-next:正文;\r\nmargin-top:15.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nmso-line-height-alt:12pt;\r\nfont-family:宋体;\r\nfont-weight:bold;\r\nfont-size:18.0000pt;\r\n}\r\n\r\nspan.10{\r\nfont-family:\'Times New Roman\';\r\n}\r\n\r\nspan.15{\r\nfont-family:\'Times New Roman\';\r\ncolor:rgb(51,122,183);\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style><p><br></p>', '2019-12-14 20:55:57', '2019-12-13 13:12:49'),
	(17, '大功率交流断路器测试方案', 26, '<p></p><p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">大功率交流断路器测试方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p>&nbsp;</p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">断路器是指能够承载和开断正常或异常回路的电流的开关装置。断路器可用来分配电能同时保护系统。当发生严重的过载，短路或欠压等故障时断路器能够自动切断电路，而且在分断故障电流后一般不需要变更零部件。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">断路器测试要求较为严苛，而大功率交流断路器测试更是为工程师提出了新的挑战。在很多厂家的测试应用中，需要测试设备提供很大的电流，极快的电流变化速率，极高的精度和可控度来仿真输入端的各种异常条件。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK为此类应用提供了一个可选的方案：大功率交流电流源+变压器。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK交流电流源不同于电压源，在各类电路条件下均不受负载的变化影响，始终保持恒定的电流输出，且其电流输出波形精准可控，瞬态响应速率极高。变压器的使用，使得输出的电压和电流可根据需求设置，满足不同等级的需求。这套方案，已经得到众多厂家的认可。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 7" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 8" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 9" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 4" ></w:LsdException>\r\n<w:LsdEx