\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt="">AMETEK交流源软件提供了如下图所示的一系列航空标准测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt="">                                                                  <img src="data:image/png;base64," style="max-width:100%;"></spanyes></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑" style="font-size: 12pt; text-indent: 24pt;">以</font><span style="font-size: 12pt; text-indent: 24pt;">MIL-STD-704为例，该测试程序允许选择从版本A到版本F的所有测试，并可以选择具体的从SAC到HDC的任意测试组别，客户还可以根据其被测物填写相应的电压，电流限值，相位等参数，甚至可以选择测试某个具体的项目。设置完成后，只需要简单的按下开始键，测试将会自动进行。</span><br></spanyes></p><p></p><p></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt="">    <img src="data:image/png;base64," style="max-width:100%;"><img src="data:image/png;base64," style="font-family: " source="" sans="" pro="" neue="" helvetica="" arial="" sans-serif="" font-size:="" max-width:=""></spanyes></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑" style="font-size: 12pt; text-indent: 24pt;">在测试控制界面，客户可以看到正在进行的测试信息，以及测试执行的状况</font><span style="font-size: 12pt; text-indent: 24pt;">.。</span><br></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">大多数的测试包含针对被测物所需一系列测试步骤。每一步客户都可以从该界面下方的测试步骤栏中看到其是如何定义的。单独以及完整的测试流程都显示在该界面中，客户可以清晰的看到测试已经进行的时间或者测试还需要多长的时间。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><font face="微软雅黑" style="font-size: 12pt; text-indent: 24pt;">在被测物表现评估界面，</font><span style="font-size: 12pt; text-indent: 24pt;">AMETEK 交流电源内置的功率分析功能可以量测被测物的电压，电流，功率，功率因素和THD等参数，并判断测试通过或者失败。而全部三相的电压和电流波形也能在软件中显示。</span><br></p><p></p><p></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt="">                                                                    <img src="data:image/png;base64," style="max-width:100%;"></spanyes></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑" style="font-size: 12pt; text-indent: 24pt;">在所有的测试完成后</font><span style="font-size: 12pt; text-indent: 24pt;">,软件左边的打印键可以提供该次测试WORD文档的报告。</span><br></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">无论是交流还是直流，波音还是空客，军用或是民用，</font>AMETEK 交流电源及软件都能为现代航空测试提供正确简单的解决方案。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">案例分享：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:18.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">1.某科研院所订购7套751iX电源，用于航空电子测试系统中。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:18.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">2.某客户订购了2套4500Ls交流电源作为自动测试系统中的一部分，这些设备将用于商用飞行控制系 统测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:18.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">3.我们从某军工单位收到2台CSW交流电源的订单，这些CSW将被用于组建航空电子器件测试台。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-fa