	(8, '航空飞行器电源模块地面老化测试方案', 19, '<p></p><p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">航空飞行器电源模块地面老化测试方案</font></spanyes></b></h3><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">航空飞行器电源模块在上天前需要完成地面老化测试以保证整个系统的稳定性和可靠性达标。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">这个测试通常使用集成化系统完成，此系统中，至少包含一台交流程控电源。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">在这类应用中要求电源满足以下要求：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:45.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">* 交直流电源。<spanyes font-size:12.0000pt=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:45.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000p