，如CSW系列产品）。在系统中，可自行编辑载入不同的三相交流测试曲线，完成对飞行器电源模块的全面性能测试。</spanyes></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\nh3{\r\nmso-style-name:"标题 3";\r\nmso-style-noshow:yes;\r\nmso-style-next:正文;\r\nmargin-top:15.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nmso-line-height-alt:12pt;\r\nfont-family:宋体;\r\nfont-weight:bold;\r\nfont-size:18.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style><p><br></p>', '2019-12-14 20:59:42', '2019-12-13 13:24:02'),
	(16, 'MOCVD行业应用方案', 26, '<p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold="">MOCVD行业应用方案</spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p> </p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">当前</font>LED产品广泛地用于<span><a href="http://ee.ofweek.com/CAT-2819-Ledlighting.html"><span yes="" font-size:12.0000pt=""><font face="微软雅黑">显示</font></span></a></span><spanyes font-size:12.0000pt=""><font face="微软雅黑">器、交</font><span><a href="http://ee.ofweek.com/CAT-2828-CommunicationNetwork.html"><span yes="" font-size:12.0000pt=""><font face="微软雅黑">通信</font></span></a></span><spanyes font-size:12.0000pt=""><font face="微软雅黑">号灯、汽车灯、手机键盘、装饰照明等行业，政府也对该产业给予大力的支持，目前的</font>LED产业是绝对的朝阳产业。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">金属有机物化学气相淀积</font>(Metal-Organic Chemical Vapor Deposition, 简称MOCVD）是生产LED晶圆的主流方法。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">一套</font>MOCVD设备中需要配备若干台高功率电源设备为系统供应能量，且不同的系统部件需求不同功率等级电源设备。MOCVD的一次制程长达数个小时，在此过程中如任何一台电源发生故障，会导致整个制程失败，损失几万美元的晶圆材料以及相应的时间。因此，对于应用于MOCVD设备中的电源来说，首要的要求就是可靠性。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK Sorensen SG系列直流电源提供了MOCVD客户所需的高可靠性的同时，还具备高精度，高功率密度，易于集成等特点，在此行业应用中，该系列产品具有良好的口碑。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 7" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 8" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 9" ></w:LsdException>