	(15, '大功率家用电器生产线供电测试方案', 21, '<p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">大功率家用电器生产线供电测试方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p> </p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">大功率家用电器在出厂前要经过一系列的测试，以验证其是否符合多种出厂要求，其中一项测试即为验证大功率家用电器在各种供电条件下能否正常工作，如欠压条件，过压条件，电压震荡条件等。为了满足此类型测试，一些厂家会选择使用交流电源来仿真模拟电网的各种表现特性。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK加州仪器提供多个系列可编程交流电源产品,功率等级覆盖百伏安至兆伏安，高精度，高可靠性。尤其需要说明的是，AMETEK交流电源标配图形化界面的操作软件，用户可根据测试要求灵活的在GUI软件上实现电压设置，频率设置， 参数瞬变等多类别操作。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<