r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">目前已有众多客户选购不同功率等级的交流电源用于大功率家用电器生产线的供电测试。</font></spanyes></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><div style="text-align: center;"><img src="data:image/png;base64," style="max-width: 100%;"></div><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;\r\nbackground:rgb(255,255,255);"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">案例分享：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:21.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">1. 某国际知名干衣机生产企业的8条生产线和4条故障检修/维修产线，每条产线配备了一套BPS30-3用以模拟供电环境。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:21.0000pt;mso-pagination:widow-orphan;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">2. 某客户订购ix系列交流电源两台，用于洗碗机产线最终测试。</spanyes></p><p class="p" style="margin-bottom: 0pt; margin-left: 21pt;"><spanyes font-size:12.0000pt="">3. 中国某知名企业订购了一台MX45交流电源用于空调的性能验证测试。</spanyes></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style>', '2019-12-14 21:12:28', '2019-12-14 21:11:23'),
	(10, '飞艇研究应用方案', 19, '<p></p><p></p><p></p><h3 align="center" style="margin: 0pt; text-align: center; mso-pagination: widow-orphan; mso-line-height-alt: 12pt;"><span style="font-weight: normal;"><spanyes font-weight:bold=""><font face="宋体">飞艇研究的应用方案</font></spanyes></span></h3><p></p><p class="p" style="text-indent: 24pt; margin-bottom: 0pt;"><spanyes style="font-weight: normal;" font-size:12.0000pt=""><font face="微软雅黑">平流层飞艇技术的研究在国内正值技术变革时期，典型的技术研究单位正在致力于此项技术的研究。</font><spanyes font-size:12.0000pt=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="text-indent: 24pt; margin-bottom: 0pt;"><spanyes style="font-weight: normal;" font-size:12.0000pt=""><font face="微软雅黑">飞艇的配电系统主要是四部分组成：多组光伏面板、电源控制器、负载和储能部分。整个系统都是直流供电用电，无需逆变。单组光伏面板产生的电压是</font>450V-480V，电流在10A以内（后期会有所增加）。光伏面板产生的能量，受自主研发的电源控制器控制为负载供电。每一组光伏面板接受电源控制器的独立控制；当需要给飞艇电池充电时，电源控制器会采用MPPT从每一组获取最大能量；当电池充满后电源控制器会退出MPPT，工作在IV曲线的稳定电压点处。<spanyes font-size:12.0000pt=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="text-indent: 24pt; margin-bottom: 0pt;"><spanyes style="font-weight: normal;" font-size:12.0000pt=""><font face="微软雅黑">配电系统测试中客户需要使用光伏模拟器来仿真光伏面板的工作性能。通常一个项目中会使用数个光伏模拟器配套的控制电脑来组成测试系统使用。由于负载消耗随时变化，客户比较关注光伏模拟器的瞬态响应能力；光伏模拟器不一定要工作在设置的</font>IV曲线的最大功率点，客户比较关注光伏模拟器在非MPPT点的输出稳定度；由于需要长时间多辐照和温度条件下测试，客户还比较关注光伏模拟器的动态模拟功能。<spanyes font-size:12.0000pt=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="text-indent: 24pt; margin-bottom: 0pt;"><span style="color: inherit; text-indent: 24pt; font-size: 12pt; font-weight: normal;">飞艇的光伏配电研究项目较新，很多测试条件和内容都不确定，客户需要实测来确定光伏模拟器是否满足要求。目前测试中某家的光伏模拟器样机，在非MPPT点时光伏模拟器输出不稳定；还有的品牌存在安全隐患。而AMETEK ETS光伏模拟器具有IV曲线分辨率高，电流噪声指标优异，高动态响应速度，具有真实的动态模拟能力。客户多次对测试结果表示满意。</span></p><p class="MsoNormal"><spanyes font-size:12.0000pt="">                                         <img style="max-width: 100%;" src="data:image/png;base64,"><br></spanyes></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\n