o;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style></p><p class="p" style="margin-bottom: 0pt; text-indent: 21.75pt;"><spanyes font-size:11.0000pt="">AMETEK 加州仪器 MX 系列交直流电源提供大功率交流输出，单三相的恒压或恒流输出模式，可编辑任意波和谐波输出，支持波形获取和谐波分析，具备能量反馈功能，是优质的电网模拟器。<spanyes font-size:10.5000pt=""><font face="微软雅黑">在实际测试中，</font>MX在双向逆变充放电式电机控制器的电网适应性测试中，其准确和稳定的输出能力，带载能力、瞬态波形电网模拟能力、任意波形模拟能力，以及操作便捷性，都有良好表现，并得到客户认可。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-bottom: 0pt; text-indent: 21.75pt;"><div style="text-align: center;"><img src="data:image/png;base64," style="font-size: 12pt; text-indent: 21.75pt; max-width: 100%;"></div><spanyes font-size:11.0000pt=""><br></spanyes></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:11.0000pt="" mso-shading:rgb=""><font face="微软雅黑">案例分享：</font></spanyes></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><font face="微软雅黑" style="font-size: 12pt; text-indent: 21.75pt;">某国内知名汽车企业选购</font><span style="font-size: 12pt; text-indent: 21.75pt;">MX45型号交直流电源，用于双向逆变充放电式电机控制器的</span><spanyes font-size:12.0000pt="" style="font-size: 12pt; text-indent: 21.75pt;"><font face="微软雅黑">电网适应性</font><spanyes font-size:11.0000pt=""><font face="微软雅黑">测试。</font></spanyes></spanyes></p><p></p><p></p><p><br></p>', '2019-12-14 20:29:49', '2019-12-13 14:54:50'),
	(12, '汽车保险丝测试方案', 20, '<p></p><p></p><p></p><p></p><p></p><p></p><p></p><h3 align="center" style="margin: 0pt; text-align: center; mso-pagination: widow-orphan; mso-line-height-alt: 12pt;"><b><spanyes font-weight:bold=""><font face="宋体">汽车保险丝测试方案</font></spanyes></b></h3><p></p><p class="p" style="background: rgb(255, 255, 255); margin: 0pt; text-align: left; text-indent: 24pt; mso-pagination: widow-orphan; mso-line-height-alt: 12pt;"><spanyes mso-shading:rgb="" font-size:12.0000pt=""><font face="微软雅黑">汽车保险丝是电流保险丝的一种，当电路电流超过保险丝限值时就会在特定的时间内熔断，起到电路保护的作用，常用于汽车电路过流保护，也可用于工业设备的过流保护。汽车保险丝的类型主要有插片式保险丝，叉栓式保险丝，汽车玻璃管保险丝等。</font><spanyes roman="" new=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="background: rgb(255, 255, 255); margin: 0pt; text-align: left; text-indent: 24pt; mso-pagination: widow-orphan; mso-line-height-alt: 12pt;"><spanyes mso-shading:rgb="" font-size:12.0000pt=""><font face="微软雅黑">在研发生产汽车保险丝时需要使用到电源来模拟短路瞬间的电路特性，这要求电源提供可控的输出电流和极快的电流斜率。</font><spanyes roman="" new=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin: 0pt; text-align: left; text-indent: 21.75pt; mso-pagination: widow-orphan; mso-line-height-alt: 12pt;"><spanyes font-size:11.0000pt=""><font face="微软雅黑">阿美特克</font>Sorensen品牌的SFA系列电源正是这样一种具有快速瞬态响应的程控电流源产品。SFA电源的电流变化速率要远远高于市场上其他产品，典型斜率可达到400A/ms。<spanyes roman="" new=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Loc