	(19, '激光二极管测试方案', 26, '<p></p><p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">激光二极管测试方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p> </p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">在切割、焊接、通信等</font><spanyes font-size:12.0000pt=""><font face="微软雅黑">行业中</font>,<spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">半导体激光二极管的应用</font><spanyes font-size:12.0000pt=""><font face="微软雅黑">越来越广泛，逐步替代了传统的激光器，因为</font><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">激光二极管</font><spanyes font-size:12.0000pt=""><font face="微软雅黑">通常</font><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">具有效率高、体积小、寿命长等优点。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></spanyes></spanyes></spanyes></spanyes></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">激光二极管实现稳定的光输出有两个常用的模式，恒功率模式和恒流模式。测试时其工作在恒流模式，因为恒流模式提供了更快的控制回路和精准的电流环境，便于准确地监测电流。这种测试方法需要一个电源来提供脉冲或可变占空比的电流信号，要求测试设备的动态响应必须精确可控</font>,电流上升和下降的速度要足够快，电流过冲要尽可能小，最好是达到忽略不计的程度。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">通常情况下客户会尝试使用常规的高功率直流电源来供给激光二极管测试所需的电流，但由于常规的直流电源本质上是电压源，其工作于恒流模式时输出电流的上升和下降速率是有限的，电流变化斜率在理想情况下也往往只有几十安培每毫秒的量级，距离激光二极管测试的要求相差甚远。所以，我们需要一台高功率的电流源来产生这些快速的电流脉冲给激光二极管来完成测试。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">阿美特克</font>Sorensen品牌的SFA系列电源正是这样一种独特的产品，是专门为高功率激光驱动器应用设计的快速瞬态响应的电流源产品，给客户此类测试提供了良好的解决方法。SFA电源的电流变化速率要远远高于市场上其他电源，可以实现激光二极管测试要求的测试电流从零开始在极短时间内上升到很高数值的要求，400A/ms。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priorit