r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\ntext-align:left;\r\nfont-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style><p><br></p>', '2019-12-14 21:29:16', '2019-12-14 21:27:35'),
	(20, '粒子加速器方案', 26, '<p></p><p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">粒子加速器方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p>&nbsp;</p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">粒</font><spanyes font-size:12.0000pt=""><font face="微软雅黑">子</font><span><a href="http://baike.baidu.com/subview/266236/15382969.htm"><u><span yes="" text-decoration:underline=""><font face="微软雅黑">加速器</font></span></u></a></span><spanyes font-size:12.0000pt=""><font face="微软雅黑">是物理实验研究的重要装置，其利用加速电场将粒子源提供的粒子加速，并用一定形态的</font><span><a href="http://baike.baidu.com/view/22141.htm"><u><span yes="" text-decoration:underline=""><font face="微软雅黑">电磁场</font></span></u></a></span><spanyes font-size:12.0000pt=""><font face="微软雅黑">来引导</font><span><a href="http://baike.baidu.com/subview/152173/11233460.htm"><u><span yes="" text-decoration:underline=""><font face="微软雅黑">约束</font></span></u></a></span><spanyes font-size:12.0000pt=""><font face="微软雅黑">被加速的</font><span><a href="http://baike.baidu.com/view/480895.htm"><u><span yes="" text-decoration:underline=""><font face="微软雅黑">粒子束</font></span></u></a></span><spanyes font-size:12.0000pt=""><font face="微软雅黑">使之沿预定轨道行进。粒子加速装置中电磁场是利用低电压，高电流的直流电源驱动电磁线圈产生的。应用于粒子加速器中的电源需要具有高输出功率的同时，要具有极高的精准度和稳定性。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></spanyes></spanyes></spanyes></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK Sorensen SG系列直流电源输出功率覆盖4kW-150kW，电压10-1000V,电流5-6000A，多个型号满足不同电压电流的需求，输出精准，稳定度高达±0.05%，并且SG系列直流电源具有多种通信接口，易于程控以实现变化的直流波形，波形和斜率均可设置，易于集成在大型系统内。这些优势特征，保证了SG系列直流电源适用于驱动电磁场的应用。某国家原子能研究所选购五十余台低电压高电流型号的SG系列直流电源用于粒子加速器的电磁激励，并对SG系列直流电源的高品质和高可靠性给予了良好的反馈。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">随着科技的发展，粒子加速器的指标要求也在不断提高，故对用于电磁激励的直流电源也提出了更高的精度和稳定度要求，其指标要求是一般的电源设备所无法企及的。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdExceptio