的电流控制。这种方案可将电源的稳定度提高至10ppm。目前这个方案以其优异的表现在国际上受到了认可。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><img src="data:image/png;base64," style="max-width:100%;"></spanyes></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑" style="font-size: 12pt; text-align: left; text-indent: 24pt;">除了提供高稳定的电流控制和回读功能，这种方案还可以检测外部联动装置和电源的故障情况。另外，</font><span style="font-size: 12pt; text-align: left; text-indent: 24pt;">PCRC还提供了一个额外的电流测量通道，支持高达1000Arms的电流测量，精度达0.001%。每个控制器可以监视两条独立的高功率总线，价格仅为传统测量设备的一小部分，却提供远超于其的分辨率。用户可以使用一个通道来读取当前受控电源的输出，而用另一个通道的独立的测试读数来验证现有的操作或者高功率系统中的其他部分</span><br></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">案例分享：</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">某国际知名单位选购了AMETEK SG系列电源用于粒子加速应用。</font></spanyes></p><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:Normal;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:\'Times New Roman\';\r\nmso-fareast-font-family:宋体;\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\ntext-align:left;\r\nfont-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style>', '2019-12-14 21:33:42', '2019-12-14 21:30:45'),
	(21, '光伏逆变器测试方案', 23, '<p></p><p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">光伏逆变器测试方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p>&nbsp;</p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">逆变器是新能源行业不可或缺的部件，其不仅具有直流交流变换功能，还具有最大限度地发挥太阳电池性能的功能和系统故障保护功能。归纳起来，其功能包括自动运行和停机、最大功率跟踪控制、防单独运行、自动电压调整、直流检测、直流接地检测等。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">光伏逆变器测试主要包含两部分，输入端测试和输出端测试。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Prio