riority="99"  SemiHidden="false"  Name="Medium Grid 1 Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Grid 2 Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Grid 3 Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Dark List Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Colorful Shading Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Colorful List Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Colorful Grid Accent 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Light Shading Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Light List Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Light Grid Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Shading 1 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Shading 2 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium List 1 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium List 2 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Grid 1 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Grid 2 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Medium Grid 3 Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Dark List Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Colorful Shading Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Colorful List Accent 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Colorful Grid Accent 6" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><style>\r\n@font-face{\r\nfont-family:"Times New Roman";\r\n}\r\n\r\n@font-face{\r\nfont-family:"宋体";\r\n}\r\n\r\n@font-face{\r\nfont-family:"Calibri";\r\n}\r\n\r\n@font-face{\r\nfont-family:"微软雅黑";\r\n}\r\n\r\np.MsoNormal{\r\nmso-style-name:正文;\r\nmso-style-parent:"";\r\nmargin:0pt;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:none;\r\ntext-align:justify;\r\ntext-justify:inter-ideograph;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:10.5000pt;\r\nmso-font-kerning:1.0000pt;\r\n}\r\n\r\nh3{\r\nmso-style-name:"标题 3";\r\nmso-style-noshow:yes;\r\nmso-style-next:正文;\r\nmargin-top:15.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nmso-line-height-alt:12pt;\r\nfont-family:宋体;\r\nfont-weight:bold;\r\nfont-size:18.0000pt;\r\n}\r\n\r\np.p{\r\nmso-style-name:"普通\\(网站\\)";\r\nmargin-top:0.0000pt;\r\nmargin-right:0.0000pt;\r\nmargin-bottom:7.5000pt;\r\nmargin-left:0.0000pt;\r\nmso-pagination:none;\r\ntext-align:left;\r\nfont-family:Calibri;\r\nmso-fareast-font-family:宋体;\r\nmso-bidi-font-family:\'Times New Roman\';\r\nfont-size:12.0000pt;\r\n}\r\n\r\nspan.msoIns{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:underline;\r\ntext-underline:single;\r\ncolor:blue;\r\n}\r\n\r\nspan.msoDel{\r\nmso-style-type:export-only;\r\nmso-style-name:"";\r\ntext-decoration:line-through;\r\ncolor:red;\r\n}\r\n@page{mso-page-border-surround-header:no;\r\n	mso-page-border-surround-footer:no;}@page Section0{\r\n}\r\ndiv.Section0{page:Section0;}</style></p><p class="p" style="margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">在输入端通常使用光伏模拟器来仿真光伏组件的输出特性，在输出端使用电网模拟器来仿真电网特性。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><spanyes font-size:12.0000pt=""><img src="data:image/png;base64," style="max-width:100%;"></spanyes></p><p class="p" style="text-align: center; margin-bottom: 0pt; text-indent: 24pt;"><br></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK ETS光伏模拟器特点：&nbsp;&nbsp;<br></spanyes></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">IV曲线分辨率高。计算的IV曲线足够平滑，贴近光伏阵列的真实情况。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">电流噪声指标优异。电流噪声直接影响到</font>MPPT的精度，噪声越高，精度越差。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">高动态响应速度。足够快的光伏模拟器才能够支持新一代高速逆变器的精确</font>MPPT测试。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">真实的动态模拟能力。高速且灵活的动态模拟能力，真正符合最新的动态测试要求如</font>EN50530。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="">AMETEK 电网模拟器特点：<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">程控交流源，支持直流输出模式。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">具有可再生模式，支持能量反灌模式。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">具备谐波生成及分析功能。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">可模拟各种类型电网扰动，测试逆变器抗扰度性能。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:24.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt=""><font face="微软雅黑">目前，电网对于光伏能源接入的要求越来越高，继前几年提出的低电压穿越要求之后，国网又提出了高电压穿越的要求。该测试项目会要求逆变器能够承受</font>1.3倍以上标称电压。对于电网模拟器而言，就是要求其高压输出能力。这对于Mx/RS是一个好消息，对于220V标称电压，上浮1.3倍是286V；如果是出货北美的逆变器，标称电压是277V，上浮1.3倍就需要360V。Mx/RS提供-HV选件支持到400V量程，还提供-XV选件支持更高电压并在电压范围内支持100%全反灌。已有客户针对逆变器测试提出高达600V以上的技术要求，并已使用RS系类产品进行测试了。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">案例分享</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:18.0000pt;mso-pagination:widow-orphan;text-align:left;\r\nmso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb="">1. 国内无锡某权威质检单位先后选购RS810电网模拟器一套，ETS光伏模拟器5台，分别用于大小功率平台的逆变器质检使用。</spanyes></p><p class="p" style="margin-bottom: 0pt; margin-left: 18pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb="">2. 多家新能源行业领军企业选购3台ETS光伏模拟器和MX电网模拟器一套，用于逆变器测试。</spanyes></p><p><br></p>', '2019-12-14 21:37:55', '2019-12-14 21:35:47'),
	(22, '微电网应用方案', 23, '<p></p><p></p><h3 align="center" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;mso-pagination:widow-orphan;text-align:center;\r\nmso-line-height-alt:12pt;"><b><spanyes font-weight:bold=""><font face="宋体">微电网应用方案</font></spanyes></b></h3><p class="MsoNormal" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:10.5000pt=""></spanyes></p><p>&nbsp;</p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">微电网（</font>micro-grid）是指由分布式电源、储能装置、能量转换装置、相关负荷和监控、保护装置汇集而成的小型发配电系统，是一个能够实现自我控制、保护和管理的自治系统，既可以与外部电网并网运行，也可以孤立运行。是智能电网的重要组成部分。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">目前微电网产业还处于研究阶段，故大多微电网客户还是使用现成的实时仿真系统，如</font>RTDS，利用软件内嵌的模型来实现虚拟的电网及挂载设备的模拟。这种实时仿真系统也有相应的硬件，可以提供相应的输入输出小信号（如0-5V）来指代系统状态，但是不具备功率带载能力。如果客户需要进行在一定功率等级上的真实测试，就必须要购买配套的电源设备或功放设备。嵌入相应的硬件后，仿真电网就能够接受实时仿真系统的实时控制，承受挂载的各种新能源设备如光伏逆变器、风机、储能电池、电动汽车充电桩等的正反向能量传输，实现在相应功率等级上的硬件模拟，以便研究各种供电来源与用电负载在各种情形下的表现。<spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p class="p" style="margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\r\nmargin-left:0.0000pt;text-indent:24.0000pt;mso-pagination:widow-orphan;\r\ntext-align:left;mso-line-height-alt:12pt;"><spanyes font-size:12.0000pt="" mso-shading:rgb=""><font face="微软雅黑">线性功放，实时性更好，动态响应较好，但价格极其昂贵；相对比较便宜的国产设备性能指标比较差。所以，选择合适的电源设备就是较合适的解决方案。</font><spanyes mso-bidi-font-family:="" new="" roman=""></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false"  DefUnhideWhenUsed="true"  DefSemiHidden="true"  DefQFormat="false"  DefPriority="99"  LatentStyleCount="260" >\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="Normal" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 6" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 7" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 8" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="heading 9" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 1" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 2" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 3" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 4" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  Name="index 5" ></w:LsdException>\r\n<w:LsdException Locked="false"  Priority="99"  SemiHidden="false"  