	(48, 14, 'images/TC.GSS • 双向储能模拟电源.png', 'files/TC.GSS产品说明书.pdf', 1, NULL, NULL, 9, 'TC.GSS • 双向储能模拟电源', 'TC.GSS 系列', '采用TopCon并网源-载电源技术，可双向操作使用，紧凑型设计，集成了EMI和正弦滤波器，自动恒压(0-100%)，恒流(0-100%)，恒功率(5-100%)工作模式，可快速穿越并指示模式状态。并可模拟内阻功能。先可供产品线：65Vdc，130Vdc，130Vdc，400Vdc，500Vdc，600Vdc，更可以通过串联获得高达1500Vdc。每挡电压产品线提供20kW和32kW功率两种功率挡产品。', '2019-12-11 14:56:29', '2020-01-06 23:37:00'),
	(49, 14, 'images/TC.P • 光伏模拟电源.png', 'files/TC.P产品说明书.pdf', NULL, NULL, NULL, 10, 'TC.P • 光伏模拟电源', 'TC.P系列', '工作模式： \r\n恒定电压（0-100%），\r\n恒定电流（0-100%），\r\n恒定功率（5-100%）  电源内阻模拟。\r\n功率范围：10kW, 16kW, 20kW,  32kW,\r\n电压范围：52V, 65V, 100V, 200V, 400V，500V, 600V, 800V, 1000 V, 1200V', '2019-12-11 15:04:18', '2019-12-11 15:04:18'),
	(50, 2, 'images/SM15KW 双向恒功率馈网电源.png', 'files/SM15KW产品说明书.pdf', 1, NULL, NULL, 11, 'SM15KW 双向恒功率馈网电源', 'SM15KW', '特性：双向电源：15KW电源+负载   输出模式：恒压，恒流，恒功率  环保节能：放电能量回馈电网  瞬态响应：100us恢复时间  上升时间：MIN1ms@10%-90%  下降时间：MIN1ms@90%-10%   极低波纹：Min.10mVrms   稳定性：50.10E6@8小时   工作温度：-20—+50度，75%输出@60度   保护功能：过压，过流，过功率，短路等\r\n功能：交流输入：342-528Vac,3L+GND  程控接口：LAN/LXI&WebViewer界面，电磁兼容：EN61000-6-2，EN61000-6-3，EN55022B,极低噪声：温控风扇，能量馈网，面板操作：大屏显示，菜单界面，数字设置：0.03%分辨率（电压、电流），效率：>95%，可靠性：长时间，野外、海洋工作环境，仿真功能：任意波形，电池模拟、光伏模拟', '2019-12-11 15:17:24', '2020-01-06 23:37:36'),
	(51, 2, 'images/SM3300W 自动双量程电源.png', 'files/SM3300产品说明书.pdf', NULL, NULL, NULL, 12, 'SM3300W 自动双量程电源', 'SM3300W', '可使用单项、三相市电供电，标配以太网通信接口，大显示屏，方便手动操作使用，耐用的数字电流电压调节旋钮，即插即用型扩展通讯接口，带有可交换输入数据和波形序列的USB接口', '2019-12-11 15:23:55', '2019-12-11 15:23:55'),
	(52, 15, 'images/WT300E功率分析仪产品图片.jpg', 'files/WT300E产品说明书.pdf', 1, NULL, NULL, 13, '横河功率分析仪', 'WT300E', '该产品在确保能耗标准和电气设备功耗测量的领域中长期扮演至关重要的角色。 WT300E系列包括：WT310E单相输入型；WT310EH单相输入/大电流型；WT332E 2输入单元型；WT333E 3输入单元型，精度为读数的0.1% +量程的0.05%。', '2019-12-11 15:37:50', '2020-01-06 23:37:49'),
	(53, 15, 'images/WT500功率分析仪产品图片.jpg', 'files/WT500产品说明书.pdf', NULL, NULL, NULL, 13, '横河功率分析仪', 'WT500', '同时测量电流、电压功率和谐波，快速更新数据（100ms)，显示数值、波形、趋势；测量买卖电能，电流量程：0.5-40A    电压量程： 15-1000V    基本功率精度：0.1%，测量带宽：0.5HZ-100KHZ', '2019-12-11 15:44:21', '2019-12-11 15:44:21'),
	(54, 15, 'images/WT1800E功率分析仪产品图片.jpg', 'files/WT1800E产品说明书.pdf', NULL, NULL, NULL, 13, '横河功率分析仪', 'WT1800E', '该产品是唯一能保证功率精度达到“ 读数的0.05% + 量程的0.05%” 的仪器， 它可以执行多达500次谐波分析(50/60Hz基波频率)。稳定性极高， 无论现在还是将来， 都可以确保完成精准的测量。', '2019-12-11 15:46:08', '2019-12-11 15:46:08'),
	(55, 15, 'images/WT3000E功率分析仪图片.jpg', 'files/WT3000E产品说明书.pdf', NULL, NULL, NULL, 13, '横河功率分析仪', 'WT3000E', '当今光伏逆变器等设备的整体工作效率已达到90%至96%。要进一步提高效率，即使是几个小数点，对制造商来说也是件极具挑战且至关重要的事情。WT3000E作为全球最精确的功率分析仪，所提供的高精度水平可以真正验证效率上的细微改进。', '2019-12-11 15:48:07', '2019-12-11 15:48:07'),
	(57, 16, 'images/DPO2000B系列数字荧光示波器.jpg', 'files/DPO2000B系列数字荧光示波器说明书.pdf', 1, NULL, NULL, 14, 'Tektronix数字荧光示波器', 'DPO2000B系列', '200、100、70 MHz 带宽型号，2 个和 4 个模拟通道型号，全部通道均实现 1 GS/s 采样率，所有通道上的记录长度均为 1 兆点，最大波形捕获速率 5,000 wfm/s，TekVPI 探头接口支持有源探头、差分和电流探头进行自动缩放和单位设置。', '2019-12-11 15:58:42', '2020-01-06 23:38:05'),
	(58, 16, 'images/DPO5000B系列数字荧光示波器.jpg', 'files/DPO5000B系列数字荧光示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix数字荧光示波器', 'DPO5000B系列', '2 GHz、1 GHz、500 MHz、350 MHz 四种带宽型号，一条或两条通道上高达 10 GS/s 的实时采样率，所有通上高达 5 GS/s 的采样率，MultiView zoom 高达 250 M 点记录长度， FastFrame 分段存储器采集模式，段数高达 290,000 个，>310,000 波形/秒的捕获速率。', '2019-12-11 16:00:07', '2019-12-11 16:43:45'),
	(59, 16, 'images/DPO7000C系列数字荧光示波器.jpg', 'files/DPO7000C系列数字荧光示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix数字荧光示波器', 'DPO7000C系列', '.5 GHz、2.5 GHz、1 GHz 和 500 MHz 带宽型号，在一条通道上提供了高达 40 GS/s 的实时采样率，在两条通道上提供了 20 GS/s 的实时采样率，在三或四条通道上提供了 10 GS/s 的实时采样率，高达 500 M 点记录长度。', '2019-12-11 16:33:25', '2019-12-11 16:44:14'),
	(60, 16, 'images/MDO3系列示波器图片.jpg', 'files/MDO3系列示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix示波器', 'MDO3系列', '3 系列 MDO 只有 6 英寸（15 厘米）深，但它具备示波器的大部分功能。提供带宽100MHz到1GHz，2通道或4通道共10个机型。每个模拟通道均实现高达 5 GS/s 的采样率，超过 125 个触发组合，几十种自动测量，众多的可用串行总线解码和触发选项，可选的 16 条数字逻辑通道，可选的集成 1 GHz 或 3 GHz 频谱分析仪，可选的 50 MHz 任意波形/函数发生器.', '2019-12-11 16:35:01', '2019-12-11 16:35:01'),
	(61, 16, 'images/MDO3000系列混合域示波器.jpg', 'files/MDO3000系列混合域示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix混合域示波器', 'MDO3000系列', '六合一综合示波器，可以全面量身定制，可以全面升级，示波器1 GHz、500 MHz、350 MHz、200 MHz 和 100 MHz带宽型号，数字电压表/频率计数器，可选配任意函数发生器，逻辑分析仪，协议分析仪，频谱分析仪升级3 GHz。', '2019-12-11 16:36:29', '2019-12-11 16:44:42'),
	(62, 16, 'images/MDO4000C系列混合域示波器.jpg', 'files/MDO4000C系列混合域示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix混合域示波器', 'MDO4000C系列', '可量身定制的、全面升级的六合一集成示波器，同步查看模拟信号、数字信号和RF 信号，示波器1 GHz、500 MHz、350 MHz、200 MHz 带宽型号，数字电压表/频率计数器，可选配频谱分析仪，任意函数发生器，逻辑分析仪，协议分析仪。', '2019-12-11 16:39:08', '2019-12-11 16:45:12'),
	(63, 16, 'images/MSO 5 系列混合信号示波器.jpg', 'files/MSO 5 系列混合信号示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix混合信号示波器', 'MSO 5 系列', '4 个、6 个或 8 个 FlexChannel输入，带宽350 MHz、500 MHz、1 GHz、2 GHz，实时 6.25 GS/s，插补500 GS/s，>500,000 个波形/秒的波形捕获率，垂直分辨率12 位 ADC，High Res 模式下高达 16 位，显示器15.6 英寸 (396 mm) TFT 彩色，容性（多触点）触摸屏。', '2019-12-11 16:48:13', '2019-12-11 16:48:13'),
	(64, 16, 'images/MSO4系列示波器.jpg', 'files/MSO4示波器说明书.pdf', NULL, NULL, NULL, 14, 'Tektronix示波器', 'MSO4系列', '4 系列 MSO 示波器。13.3 英寸高清显示屏，6.1 英寸（15.5 厘米）深，适合有限的工作台空间， 4 或 6 路 FlexChannel 输入，每个 FlexChannel 提供一个模拟信号输入或者连接TLP058 探头实现 8 路数字逻辑输入，200 MHz、350 MHz、500 MHz、1 GHz 或 1.5 GHz，在所有模拟/数字通道上实时采样率高达 6.25 GS/s，记录长度31.25 或 62.5 M 点', '2019-12-11 16:50:41', '2019-12-11 16:50:41'),
