	(102, 16, 'images/TLA7000 系列逻辑分析仪.jpg', 'files/TLA7000 系列逻辑分析仪说明书.pdf', NULL, NULL, NULL, 17, '逻辑分析仪', 'TLA7000 系列', '68/102/136通道逻辑分析仪模块，最高记录长度每通道512Mb， MagniVuTM 高精度定时采集技术提供20ps(50GHz)的时序分析精度，最高支持156ps(6.4GHz)/512Mb 长度的定时分析， 同步采集数据有效窗口180ps，最高支持1.4GHz 以及最高3.0Gbps 数据的高性能状态分析。', '2019-12-12 19:35:31', '2019-12-12 19:35:31'),
	(97, 16, 'images/RSA500A 系列USB 频谱分析仪.jpg', 'files/RSA500A 系列USB 频谱分析仪说明书.pdf', NULL, NULL, NULL, 17, 'USB 频谱分析仪', 'RSA500A 系列', 'RSA500A 系列USB 频谱分析仪在坚固耐用、电池供电的仪器中提供了高性能便携式频谱分析功能。9 kHz - 3.0/7.5 GHz 频率范围满足各种分析需，40 MHz 采集带宽支持实时分析，捕获瞬态信号，进行矢量分析，标准 GPS/GLONASS/北斗接收机，用于绘制地图。', '2019-12-12 19:23:00', '2019-12-12 19:23:00'),
	(98, 16, 'images/RSA600A 系列USB 频谱分析仪.jpg', 'files/RSA600A 系列USB 频谱分析仪说明书.pdf', NULL, NULL, NULL, 17, 'USB 频谱分析仪', 'RSA600A 系列', 'RSA600A 系列USB 频谱分析仪在携带异常方便的小型仪器中提供了高带宽实验室频谱分析功能。9 kHz - 3.0/7.5 GHz 频率范围，满足各种分析需求，40 MHz 采集带宽，实现实时分析，支持瞬态信号捕获和矢量分析，标配 GPS/GLONASS/ 北斗接收机。', '2019-12-12 19:24:19', '2019-12-12 19:24:19'),
	(99, 16, 'images/RSA5000B 系列频谱分析仪.jpg', 'files/RSA5000B 系列频谱分析仪说明书.pdf', NULL, NULL, NULL, 17, '频谱分析仪', 'RSA5000B 系列', '提供了行业领先的实时指标，包括100%检测概率最短的最短信号持续时间及最好的实时动态范围。宽带矢量信号分析仪功能以及实时频谱分析仪独特的触发、捕获、分析功能，分为3 GHz、6.2 GHz、15 GHz和26.5 GHz四个型号。', '2019-12-12 19:25:57', '2019-12-12 19:25:57'),
	(100, 16, 'images/TLA7SA00 系列PCI Express 逻辑协议分析仪.jpg', 'files/TLA7SA00 系列PCI Express 逻辑协议分析仪说明书.pdf', NULL, NULL, NULL, 17, 'PCI Express 逻辑协议分析仪', 'TLA7SA00 系列', 'PCI Express Gen1、Gen2 和Gen3 从协议层到物理层分析，支持x1 - x16 链路宽度及高达8.0 GT/s 的采集速率，完善的PCI Express 探测解决方案，包括中间总线、插槽内插器和焊接探头，（要求装有TLA v5.7 或以上版本软件的TLA7012 或TLA7016 主机）。', '2019-12-12 19:29:04', '2019-12-12 19:29:04'),
	(101, 16, 'images/TLA6400 系列逻辑分析仪.jpg', 'files/TLA6400 系列逻辑分析仪说明书.pdf', NULL, NULL, NULL, 17, '逻辑分析仪', 'TLA6400 系列', '杰出的性能，简便易用，调试、验证和优化数字系统，40 ps分辨率MagniVu采集技术，状态速率－时钟速率高达667 MHz，数据速率高达1333Mb/s， 15 英寸显示器，选配触摸屏，查看更多数据， 4种型号，34/68/102/136条通道，高达64 Mb记录长度。', '2019-12-12 19:30:28', '2019-12-12 19:30:28'),
	(103, 16, 'images/TTR500 系列矢量网络分析仪 (VNA).jpg', 'files/TTR500 系列矢量网络分析仪 (VNA)说明书.pdf', NULL, NULL, NULL, 17, '矢量网络分析仪 (VNA)', 'TTR500 系列', 'TTR50系列 2端口2路矢量网络分析仪提供传统支持和质量保证，确保您轻松使用仪器并降低运营成本。频率范围：100 kHz - 6 GHz,动态范围：大于 122 Db,轨迹噪声：小于 0.008 dBrms,输出功率：-50 - +7 dBm', '2019-12-12 19:38:26', '2019-12-12 19:38:26'),
	(104, 16, 'images/RSA306B  系列USB 实时频谱分析仪.jpg', 'files/RSA306B USB 实时频谱分析仪说明书.pdf', NULL, NULL, NULL, 17, 'USB 实时频谱分析仪', 'RSA306B系列', '使用您的电脑和泰克SignalVu-PC RF 信号分析软件，为9 kHz - 6.2 GHz 信号提供实时频谱分析、流式捕获和深入信号分析功能，而且价格经济，携带异常方便，特别适合现场、工厂或科研应用。', '2019-12-12 19:41:06', '2019-12-12 19:41:06'),
	(105, 16, 'images/RSA7100A 宽带信号分析仪.jpg', 'files/RSA7100A 宽带信号分析仪说明书.pdf', NULL, NULL, NULL, 17, '宽带信号分析仪', 'RSA7100A系列', 'RSA7100A 宽带信号分析仪在一个解决方案中提供高达 800 MHz 带宽的实时频谱分析，以及以全带宽流式存储无缝数据（长达 2 小时）。通过 SignalVu-PC，16 kHz 至 14/26.5 GHz 频率范围涵盖了广泛的分析需求，包括调制、脉冲、WLAN 和频率/相位稳定测量。', '2019-12-12 19:45:21', '2019-12-12 19:45:21'),
	(106, 16, 'images/相干光信号分析仪OM系列.jpg', 'files/相干光信号分析仪OM系列.pdf', NULL, NULL, NULL, 17, '相干光信号分析仪', 'OM系列', '随着网络需求的增加，远距离通信变得越来越复杂。信号已从简单的开关键控形式发展为 DP-QPSK 和 PM-16QAM 等复杂的调制格式。对于 100G、400G、1Tb/s 及以上的最新通信体系，需要使用高级测试工具进行测试。泰克是能够提供完整相干光测试系统（从信号发生到调制、采集和分析）的唯一测试和测量供应商。', '2019-12-12 19:46:22', '2019-12-12 19:46:22'),
	(107, 16, 'images/TSG4100A 系列RF 矢量信号发生器.jpg', 'files/TSG4100A 系列RF 矢量信号发生器说明书.pdf', 1, NULL, NULL, 18, 'RF 矢量信号发生器', 'TSG4100A 系列', '模拟和矢量/数字信号发生功能，真正的DC - 2 GHz、4 GHz 或6 GHz，支持生成模拟信号和矢量/数字信号，10 MHz - 6 GHz 时≤±0.30 dB 的典型幅度精度(0 dBmCW 信号 @ 22 ºC)，I/Q 调制输入(400 MHz RF 带宽， ASK, FSK, MSK, PSK, QAM, VSB 和自定义I/Q。', '2019-12-12 19:56:45', '2020-01-06 23:40:54'),
	(108, 16, 'images/函数任意波形发生器AFG1022.jpg', 'files/函数任意波形发生器AFG1022说明书.pdf', NULL, NULL, NULL, 18, '函数任意波形发生器', 'AFG1022系列', 'AFG1022 任意函数发生器提供了最佳性能价格比的波形发生工具。它包括双通道、25MHz 带宽和高达 10Vp-p 的输出幅度。4 种运行模式、50 种内置常用波形和内置 200MHz 频率计数器，满足试验和测试工作中的大多数波形发生需求。', '2019-12-12 19:58:48', '2019-12-12 19:59:02'),
	(109, 16, 'images/函数任意波形发生器AFG1062.jpg', 'files/函数任意波形发生器AFG1062说明书.pdf', NULL, NULL, NULL, 18, '函数任意波形发生器', 'AFG1062系列', 'AFG1062 任意波形发生器提供了性价比最好的波形生成工具。双通道，60MHz 带宽，最高 10 Vp-p 输出幅度。4 种运行模式、50 种内置常用波形和内置 200 MHz 频率计数器，满足试验和测试工作中的大多数波形发生需求。', '2019-12-12 20:00:48', '2019-12-12 20:00:48'),
	(110, 16, 'images/函数任意波形发生器AFG3011C.jpg', 'files/函数任意波形发生器AFG3011C说明书.pdf', NULL, NULL, NULL, 18, '函数任意波形发生器', 'AFG3011C系列', '无可比拟的性能、通用性、直观的操作和经济性，使之成为业内最实用的仪器。可以选择 12 种不同的标准波形。可以以高采样率生成长度达 128 K 的任意波形。单通道，最高 10 MHz 正弦波，可以产生 14 位，250 MS/s 任意波形，高达 20 Vp-p 的幅度（50 欧姆负载）。', '2019-12-12 20:02:34', '2019-12-12 20:02:34'),
