	(120, 16, 'images/函数任意波形发生器AFG3252C.jpg', 'files/函数任意波形发生器AFG3252C说明书.pdf', NULL, NULL, NULL, 18, '函数任意波形发生器', 'AFG3252C系列', '无可比拟的性能、通用性、直观的操作和经济性，使之成为业内最实用的仪器。可以选择 12 种不同的标准波形。可以生成长度达 128 K 的任意波形。双通道，最高 240 MHz正弦波，可以产生 14 位，最高 2 GS/s 任意波形，最大 5 Vp-p 的幅度（50 欧姆负载）。', '2019-12-12 20:22:55', '2019-12-12 20:22:55'),
	(121, 16, 'images/函数任意波形发生器AFG2021.png', 'files/函数任意波形发生器AFG2021说明书.pdf', NULL, NULL, NULL, 18, '函数任意波形发生器', 'AFG2021系列', '20 MHz 正弦波、10 MHz 方波和脉冲波形，满足最常见的应用，250 MS/s 采样率和 14 位垂直分辨率，可以创建高保真信号，创新的用户界面，直接进入常用功能和参数，缩短设置时间和评估时间。', '2019-12-12 20:28:14', '2019-12-12 20:29:37'),
	(122, 16, 'images/脉冲发生器PSPL2600C、2600CTURBO.jpg', 'files/脉冲发生器PSPL2600C、2600CTURBO说明书.pdf', NULL, NULL, NULL, 18, '脉冲发生器', 'PSPL2600C、2600CTURBO系列', 'PSPL2600C和PSPL2600C-TURBO脉冲发生器提供了高幅度正脉冲或负脉冲及方便的前面板控制功能。输出拥有快速边沿速率、平滑的跳变及最小过冲和振铃。可调节的输出电平使用内部阶跃衰减器获得，确保所有设置上都实现一致的信号形状。输出是为50 Ω阻抗设计的，但可以安全地驱动从短路到开路的任何负载。', '2019-12-12 20:31:05', '2019-12-12 20:31:05'),
	(123, 16, 'images/脉冲信号发生器PSPL10050A、10060A、10070A.jpg', 'files/脉冲信号发生器PSPL10050A、10060A、10070A说明书.pdf', NULL, NULL, NULL, 18, '脉冲信号发生器', 'PSPL10050A、10060A、10070A', 'PSPL10000系列脉冲发生器通过方便的前面板或计算机控制提供了优异的信号完整性。高压输出拥有快速的边沿速率、平滑的跳变和最小的过冲和振铃。可调节输出电平使用内部阶跃衰减器获得，确保在所有设置上实现一致的信号形状。输出是为50 Ω阻抗设计的，但可以安全地驱动从短路到开路的任何负载。', '2019-12-12 20:32:02', '2019-12-12 20:32:02'),
	(124, 4, 'images/737f3dc8ac327a65278beb20465e8710.jpg', 'files/c0e878317238e0da4239ca844ef25337.doc', 1, NULL, NULL, 19, '航裕单相变频电源', 'HY-BPK11系列', '输出功率：500VA～10KVA可选\r\n输出电压：低档0～150.00V，高档150.01V～300.00V调节分辨率0.01V\r\n输出频率：45Hz～100.00Hz调节分辨率0.01Hz\r\n电路方式：IGBT-SPWM\r\n安装方式：1KVA以下 19英寸4U标准柜上架安装，也可以桌面摆放\r\n通讯方式：标配RS-232，可选配RS-485或模拟量或GPIB通讯接口\r\n产品特点：采用新型的控制方式，使用更方便。', '2019-12-13 12:25:44', '2020-01-06 23:38:50'),
	(125, 4, 'images/HY-BPK31系列单相变频电源.jpg', 'files/HY-BPK31系列单相变频电源简介.doc', NULL, NULL, NULL, 19, '航裕单相变频电源', 'HY-BPK31系列', '输出功率：10KVA～400KVA可选\r\n输出电压：低档0～150.00V，高档150.01V～300.00V调节分辨率0.01V\r\n输出频率：45Hz～100.00Hz调节分辨率0.01Hz\r\n电路方式：IGBT-SPWM\r\n通讯方式：标配RS-232，可选配RS-485或模拟量或GPIB通讯接口\r\n产品特点：采用新型的控制方式，使用更方便。', '2019-12-13 12:28:55', '2019-12-13 12:28:55'),
	(126, 4, 'images/HY-BPX系列单相变频电源 （线性放大式）.jpg', 'files/HY-BPX系列单相变频电源 （线性放大式）简介.doc', NULL, NULL, NULL, 19, '单相变频电源 （线性放大式）', '航裕单相变频电源 （线性放大式）', '输出功率：300VA-10KVA\r\n电路方式：线性放大式\r\n安装方式：1500VA以下19英寸标准柜安装方式，3000VA以上机柜式\r\n通讯方式：可选配RS-232或RS-485或GPIB通讯接口,或选配DC0-10V模拟量\r\n产品特点：采用新型的线性放大线路设计，低噪声、高稳定性\r\n产品简介：采用DSP结合PFGA控制技术，测试与控制流程可完全实现自动化智能化。 \r\n功能介绍：多种模式可选择，三相相位可调模式、三相频率分调模式、三相电压分调模式、三相并联为单相模式，有记忆组功能，歩阶功能，可编程功能等。', '2019-12-13 12:31:34', '2019-12-13 12:31:34'),
	(127, 4, 'images/HY-BPK33系列三相变频电源.jpg', 'files/HY-BPK33系列三相变频电源 简介.doc', NULL, NULL, NULL, 20, '航裕三相变频电源', 'HY-BPK33系列', 'HY-BPK33系列三相变频电源 （三相输入三相输出）\r\n输出功率：6KVA～1200KVA可选\r\n输出电压：低档0～150.00V，高档150.01V～300.00V调节分辨率0.01V\r\n输出频率：45Hz～100.00Hz调节分辨率0.01Hz\r\n电路方式：IGBT-SPWM\r\n通讯方式：标配RS-232，可选配RS-485或模拟量或GPIB通讯接口\r\n产品特点：采用新型的控制方式，使用更方便。', '2019-12-13 12:33:25', '2019-12-13 12:33:25'),
	(128, 4, 'images/HY-BPK1300系列小功率 三相交流电源.jpg', 'files/HY-BPK1300系列小功率 三相交流电源.doc', NULL, NULL, NULL, 20, '航裕小功率 三相交流电源', 'HY-BPK1300系列小功率', 'HY-BPK1300系列三相变频电源（单相输入三相输出）\r\n输出功率：1500VA-3KVA\r\n电路方式：IGBT-SPWM\r\n安装方式：19英寸标准柜安装方式\r\n通讯方式：可选配RS-232或RS-485或GPIB通讯接口,或选配DC0-10V模拟量\r\n产品特点：采用新型的开关器件制作，体积小，噪音低，操作性方便\r\n产品简介：采用DSP结合PFGA控制技术，测试与控制流程可完全实现自动化智能化。 \r\n功能介绍：多种模式可选择，三相相位可调模式、三相频率分调模式、三相电压分调模式、三相并联为单相模式，有记忆组功能，歩阶功能，可编程功能等。', '2019-12-13 12:34:49', '2019-12-13 12:34:49'),
	(129, 4, 'images/可编程直流电源（液晶显示）.jpg', NULL, NULL, NULL, NULL, 21, '航裕可编程直流电源（液晶显示）', '可编程直流电源（液晶显示）', '小型机架安装尺寸（1U,2U,3U,4U\r\n标准19英寸机架安装尺寸\r\n灵活的使用功能，可脱离上位机编程输出，按键加飞梭旋钮调节方式\r\n功率等级750W，1500W， 2400W，3300W，5KW，10kW，15kW\r\n高效率高功率因素（内置PFC功能）\r\n输出范围：0-6000V, 0-1000A可选\r\n低噪音，高精度，高稳定性输出\r\n丰富的通讯接口选择RS232，RS485串行通信标准配置,\r\n选配GPIB，LAN，隔离型模拟编程功能0-5V，0-10V，4-20mA\r\n高精度的控制与显示：内置16位AD, DA转换器\r\n我们的特色：接受任意定制，可定制多路输出', '2019-12-13 12:37:00', '2019-12-13 12:37:00'),
	(130, 4, 'images/直流电源(LED显示）.jpg', NULL, NULL, NULL, NULL, 21, '航裕直流电源(LED显示）', '直流电源(LED显示）', '超小型机架安装尺寸（1U,2U,3U,4U\r\n标准19英寸机架安装尺寸\r\n功率等级750W，1500W， 2400W，3300W，5KW，10kW，15kW\r\n高效率高功率因素（内置PFC功能）\r\n输出范围：0-6000V, 0-1000A可选\r\n低噪音，高精度，高稳定性输出\r\n丰富的通讯接口选择RS232，RS485串行通信标准配置,\r\n选配GPIB，LAN，隔离型模拟编程功能0-5V，0-10V，4-20mA\r\n高精度的控制与显示：内置16位AD, DA转换器\r\n我们的特色：接受任意定制，可定制多路输出', '2019-12-13 12:38:17', '2019-12-13 12:38:17'),
	(131, 17, 'images/IT8200.png', 'files/IT8211产品规格书.pdf', 1, NULL, NULL, 22, '艾德克斯直流电子负载', 'IT8200系列', '经济型数控电子负载   电压：0-60V  电流：0-30A  功率：150W', '2019-12-13 12:47:06', '2020-01-06 23:39:06'),
	(132, 17, 'images/IT8500系列.png', 'files/IT8500系列规格书.pdf', NULL, NULL, NULL, 22, '艾德克斯直流电子负载', 'IT8500系列', '可编程电子负载  电压：最大可到500V  电流：最大可到480A  功率：120-5000W', '2019-12-13 12:49:11', '2019-12-13 12:49:11'),
	(133, 17, 'images/IT8700多通道系列.png', 'files/IT8700系列规格书.pdf', NULL, NULL, NULL, 22, '艾德克斯直流电子负载', 'IT8700系列', 'IT8700系列单个机框可实现1~8路电子负载功能，扩展机框可实现1~16路电子负载功能，单路电子负载模块有5个型号可供选择（200~600W），双路电子负载模块有两个型号可供选择。', '2019-12-13 12:50:53', '2019-12-13 12:50:53'),
	(134, 17, 'images/IT8800系列.png', 'files/IT8800系列规格书.pdf', NULL, NULL, NULL, 22, '艾德克斯直流电子负载', 'IT8800系列', '150~55KW，55KW以上接收定制，电压/电流测量速度最高可达50KHz，分辨率可达0.1mV/0.01mA。该系列的电流上升速度在0.0001A/us~2.5A/us的范围内可调', '2019-12-13 12:52:19', '2019-12-13 12:52:19'),
	(135, 17, 'images/IT8900系列.jpg', 'files/IT8900系列规格书.pdf', NULL, NULL, NULL, 22, '艾德克斯直流电子负载', 'IT8900系列', '提供150V/600V/1200V三种电压范围，可将功率扩展至600KW。50KHz高速测量、瞬间过功率加载能力、Measure量测功能、25KHz动态测试等多种精准量测功能，应用于电源供应器，动力电池、直流充电桩、发电机、军工航天等领域。', '2019-12-13 12:53:33', '2019-12-13 12:53:33'),
	(136, 17, 'images/IT8912E系列.png', 'files/IT8912E系列规格书.pdf', NULL, NULL, NULL, 22, '艾德克斯直流电子负载', 'IT8912E系列', '300W/500V/15A，LED测试专用电子负载，独特的硬件电路实现CR-LED模式，具有可调频率、占空比PWM调光输出口。可以测试LED恒流源的电流脉动及开启瞬间的浪涌电流。电压/电流测量速度最高可达50KHz', '2019-12-13 12:54:44', '2019-12-13 12:54:44'),
	(137, 17, 'images/IT8600系列产品图片.jpg', 'files/IT8600系列规格书.pdf', NULL, NULL, NULL, 23, '艾德克斯交直流电子负载', 'IT8600系列', '交/直流电子负载，独有的示波器显示功能，可显示电压和电流输入波形。具有浪涌电流，峰值，有效值及PF等参数量测模式，更可量测高达50次的电压谐波，全面分析待测物性能。频率范围：45~450HZ  功率范围：0~14.4kVA   电压范围：50~420Vrms、15~260Vrms  电流范围：0~160Arms', '2019-12-13 12:56:48', '2019-12-13 12:56:48'),
